import React from 'react';
import Song from './Song'

const Songs = ({ songs, match, deleteSong }) => {

    const playlistSongs = songs.filter( song => song.playlistIds.includes(parseInt(match.params.playlistId, 10)))
    const renderList = () => playlistSongs.map( song => <Song match={match} song={song} deleteSong={deleteSong} /> )

    return <div> { playlistSongs.length > 0 ? <div>{renderList()}</div> : <div>Add a song</div> } </div>

  }

  export default Songs;
